// ==/UserScript==



function obliterateNode(node){
  if(!node)
    return
  node.innerText=""
  Object.keys(node).forEach(key=>{
      node[key] = undefined;
  })
}

function udpateRecords(records){
  document.querySelectorAll("div").forEach(node=>{
    if(window.location.href.includes("x.com/home")){
    if (node.getAttribute("aria-label") === "Timeline: Your Home Timeline")
      setTimeout(()=>obliterateNode(node),0)
    }
  })
}

const mutationObserver=new MutationObserver(udpateRecords)
mutationObserver.observe(document, {attributes: true, childList: true, subtree: true});
